import React from 'react';
const TodoList = () => {
    return(
        <div>
            <form>
                <label>Description:</label><input type = 'text'/><br/>
                <label>Date:</label><input type = 'Date'/><br/>
                <label>Time:</label><input type = 'Time'/><br/>
            </form>
        </div>
    )
}
export default TodoList;
